import './App.css';
import Home from './pages/Home';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

import Leftbar from './component/Leftbar';
function App() {
  return (
    <div className="App">
      <Leftbar/>




      <BrowserRouter>

    <Router>
      <Routes>
        <Route path="/" element={<Home />} />

      </Routes>
    </Router>
    </BrowserRouter>

    </div>


  );
}

export default App;
